import React, { useState } from "react";

import "./index.css";

export const App = () => {

  let [count, setCount] = useState(0);
  let date = () => {
    console.log(date.toLocaleTimeString('en-GB'));
  }
  const IncNum = () => {
    setCount(count++)
  };
  return (
    <>
      <h1 className="heading">{date}</h1>
      <button onClick={IncNum}> Get latest time! </button>
    </>
  );
};
